import React from 'react';
import CardInfoCl from './cardInfo.module.scss';
import OldPrice from '../oldPrice/oldPrice';
import Price from '../price/price';


const CardInfo = (props) => {
  return(
          
    <div className={CardInfoCl.info}>
      <div className={CardInfoCl.starIcon}></div>
      <div className={CardInfoCl.deliveryIcon}></div>
      <OldPrice oldprice={props.oldPrice}/>
      <Price price={props.price}/>
      <div className={CardInfoCl.cardName}>{props.title}</div>
      <div className={CardInfoCl.cityDate}>{props.date}</div>
    </div>
          
  );
}

export default CardInfo;
